import React from 'react';
import cardType from './cardType.component'

class cardTypeList extends React.Component{
    render(){
        return(
            <table>
                <th>ID</th>
                <th>Title</th>
                <th>Desc.</th>
            </table>,
            [cardType]
        )
    }
}

export default cardTypeList;
